import{createInstance}from"../keyword/create-instance.min.js";import{SupplementaryModel}from"../model/supplementary-model.min.js";import{PageColorAdjuster}from"../shared/page-color-adjuster.min.js";import{Buildable}from"../interface/buildable.min.js";import ScriptSeriesLoader from"../shared/script-series-loader.min.js";class SupplementaryController extends Buildable{constructor(){super(),this.model=new SupplementaryModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.load()}static build=async()=>{const e=new SupplementaryController;for(;e.scriptLoader.running;)await ThreadingUtility.sleep(2e3);return e};execute=async()=>{(await createInstance(PageColorAdjuster)).changeBackgroundColor(),$("body").addClass("loaded")}}export{SupplementaryController};